import logo from './logo.svg';
import Input from './components/Input.js'
import './App.css';
import SubmitButton from './components/Submit';

function App() {
  return (
    <div className="App container">
      <header className="App-header">
        <h1>Diet Planner</h1>
      </header>
      <Input type="text" className="" p="protein" />
      <Input type="text" className="" p="weight" />
      <Input type="text" className="" p="total" />
      <SubmitButton className="App" />
    </div>
  );
}

export default App;
